namespace RamaPlotType
{
    const unsigned int General = 0;
    const unsigned int Gly = 1;
    const unsigned int Pro = 2;
    const unsigned int PrePro = 3;
}

class RamaDataBase
{
public:
    virtual ~RamaDataBase()
    {
    }
    virtual unsigned int NumLines() const = 0;
    virtual unsigned int NumSegs(unsigned int line) const = 0;
    virtual float X(unsigned int line, unsigned int seg) const = 0;
    virtual float Y(unsigned int line, unsigned int seg) const = 0;

    // return 0: disallowed; 1: allowed; 2: preferred
    virtual unsigned int region(float phi, float psi) = 0;
};

class OrigRamaData : public RamaDataBase
{
public:
    OrigRamaData();
    virtual ~OrigRamaData()
    {
    }

    unsigned int NumLines() const
    {
        return _line_count;
    }

    unsigned int NumSegs(unsigned int line) const
    {
        return _seg_count[line];
    }

    float X(unsigned int line, unsigned int seg) const
    {
        return _x[line][seg];
    }

    float Y(unsigned int line, unsigned int seg) const
    {
        return _y[line][seg];
    }

    // return 0: disallowed; 1: allowed; 2: preferred
    unsigned int region(float phi, float psi);

private:
    unsigned int _line_count;
    unsigned int _seg_count[3];
    float **_x, **_y;
};



class RichardsonRamaData : public RamaDataBase
{
public:
    RichardsonRamaData(unsigned int type = RamaPlotType::General, bool preferred = true);
    virtual ~RichardsonRamaData()
    {
    }

    unsigned int NumLines() const
    {
        return _line_count;
    }

    unsigned int NumSegs(unsigned int line) const
    {
        if (!_seg_count)
        {
            return 0;
        }
        return _seg_count[line];
    }

    float X(unsigned int line, unsigned int seg) const
    {
        return _x[line][seg];
    }

    float Y(unsigned int line, unsigned int seg) const
    {
        return _y[line][seg];
    }

    // return 0: disallowed; 1: allowed; 2: preferred
    unsigned int region(float phi, float psi);

private:
    float **_x, **_y;
    unsigned int _line_count;
    unsigned int *_seg_count;
    unsigned int _type;
};

